import { useEffect, useInsertionEffect, useState } from "react";
import { Link, Switch, Route } from "react-router-dom";
import "../node_modules/bootstrap/dist/css/bootstrap.css";
import "./common.css";
import { useNavigate } from "react-router-dom";
import { useParams } from "react-router-dom";
import { getEmpList } from "./services/user";
import { deleteEmp as deleteEmpApi } from "./services/user";

import { toast } from "react-toastify";
import userEvent from "@testing-library/user-event";

function Orders(){


    return (
        <>
          <div className="length">
            <div>
              <table className="table table-bordered">
                <thead>
                  <tr className="colr">
                    <td>orderId</td>
                    <td>orderWeight</td>
                    <td>fromAddress</td>
                    <td>toAddress</td>
                    <td>orderStatus</td>
                    <td>orderdDate</td>
                    <td>ecpectedDeliveryDate</td>
                    <td>amount</td>
                    <td>trackingId</td>
                  </tr>
                </thead>

                <tbody>
                  {orders.map((order) => {
                    return (
                      <tr key={order.orderId}>
                        <td>{order.orderId}</td>
                        <td>{order.orderWeight}</td>
                        <td>{order.fromAddress}</td>
                        <td>{order.toAddress}</td>
                        <td>{order.orderStatus}</td>
                        <td>{order.orderdDate}</td>
                        <td>{order.ecpectedDeliveryDate}</td>
                        <td>{order.amount}</td>
                        <td>{order.trackingId}</td>



                      </tr>
                    );
                  })}
                  ;
                </tbody>
              </table>

            </div>
          </div>
        </>
      );


}

export default Orders;
